import React from 'react';

const Step4 = ({ prevStep }) => {
    return (
        <div>
            <h2>Success!</h2>
            <p>You have successfully signed up.</p>
            <button onClick={prevStep}>Back</button>
        </div>
    );
};

export default Step4;
